import React from 'react';
import { Box, Button, TextField, Typography, Paper } from '@mui/material';

function Login() {
  return (
    <Box sx={{ minHeight: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center', bgcolor: 'background.default' }}>
      <Paper elevation={6} sx={{ p: 4, maxWidth: 400, width: '100%', textAlign: 'center', borderRadius: 3 }}>
        <img src="/logo.png" alt="Logo NEOFI" style={{ height: 70, marginBottom: 20 }} />
        <Typography variant="h5" color="primary" gutterBottom>Acesse o sistema NEOFI</Typography>
        <TextField label="Usuário ou E-mail" fullWidth margin="normal" />
        <TextField label="Senha" type="password" fullWidth margin="normal" />
        <Button variant="contained" color="primary" fullWidth sx={{ mt: 2 }}>Entrar</Button>
        <Typography variant="body2" color="text.secondary" sx={{ mt: 3 }}>© 2025 neo.fi finance</Typography>
      </Paper>
    </Box>
  );
}

export default Login;
